import React from 'react';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-brand">Your Logo</div>
      <div className="search-card-container">
        <div className="stock-code__value">
          <input type="text" placeholder="Stock Code" />
        </div>
        <button className="btn-search">
          Search <svg width="16" height="16" fill="currentColor" className="bi bi-search" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">
            <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001a6.5 6.5 0 0 0 1.398-1.398zm3.714-1.056a7 7 0 1 1-1.414 1.414h-.001a7 7 0 0 1 1.414-1.414z"/>
            <path fillRule="evenodd" d="M9.5 0a.5.5 0 0 1 .5.5V7a.5.5 0 0 1-1 0V.5a.5.5 0 0 1 .5-.5z"/>
          </svg>
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
